This sample shows how to call UploadFileAsync and parse the result.

Uri endpoint = new Uri("<https://my-service.azure.com>");
TokenCredential credential = new DefaultAzureCredential();
SessionResourceFiles client = new AppClient(endpoint, credential).GetSessionResourceFilesClient(apiVersion: "2023-08-01-preview");

using RequestContent content = RequestContent.Create(new
{
    file = File.OpenRead("<filePath>"),
});
Response response = await client.UploadFileAsync(Guid.Parse("73f411fe-4f43-4b4b-9cbd-6828d8f4cf9a"), "<resourceGroupName>", "<sessionPoolName>", "<fileName>", "<identifier>", content, "multipart/form-data");

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
Console.WriteLine(result.GetProperty("value")[0].GetProperty("fileName").ToString());
Console.WriteLine(result.GetProperty("value")[0].GetProperty("properties").GetProperty("fileName").ToString());
Console.WriteLine(result.GetProperty("value")[0].GetProperty("properties").GetProperty("sizeInBytes").ToString());
Console.WriteLine(result.GetProperty("value")[0].GetProperty("properties").GetProperty("lastModifiedAt").ToString());

